  const [textToggle, textToggleState] = useState(true)
  return (
    <div className="App">
       <div className="Tog">
       <button className='btnHead' onClick={ () => textToggleState(!textToggle) }>Upload or Capture</button>
       </div>
       {
 textToggle ?
 <Form />

 :
<div className="Cam"><Camera /> </div>
}


    </div>
  );
}

export default App;









